const API_BASE_URL = "http://192.168.1.41:8080";

const outputGameId = document.getElementById('outputGameId');
const outputPlayerXId = document.getElementById('outputPlayerXId'); // Cambiado
const outputPlayerOId = document.getElementById('outputPlayerOId'); // Nuevo
const outputBoard = document.getElementById('outputBoard');
const outputWinner = document.getElementById('outputWinner');
const outputError = document.getElementById('outputError');

let gameId;
let playerId;
let board;
let winner;
let inGame = false;

export function getGameId(){
    return gameId;
}

export function getBoard(){
    return board;
}

export function getWinner(){
    return winner;
}

export function getInGame(){
    return inGame;
}

export async function createGame(){
    return fetch(`${API_BASE_URL}/create`, {
        method: "POST",
        headers: {
            "Content-Type": "application/json"
        },
        body: JSON.stringify({}),
    })
    .then(response => response.json())
    .then(data => {
        gameId = data.idPartida;
        playerId = data.idPlayerX;
        board = data.board;
        winner = data.ganador;
        inGame = data.enJuego;

        outputGameId.textContent = `Game ID: ${gameId}`;
        outputPlayerXId.textContent = `Player X ID: ${playerId}`; // Actualizado
        outputBoard.textContent = `Board: ${JSON.stringify(board)}`;
        outputWinner.textContent = `Winner: ${winner}`;
    })
    .catch(error => {
        outputError.textContent = `Error: ${error}`;
    });
}

export async function joinGame() {
    gameId = document.getElementById("gameId").value;
    return fetch(`${API_BASE_URL}/join/${gameId}`)
        .then(response => response.json())
        .then(data => {
            gameId = data.idPartida;
            playerId = data.idPlayerO;
            board = data.board;
            winner = data.ganador;

            outputGameId.textContent = `Game ID: ${gameId}`;
            outputPlayerOId.textContent = `Player O ID: ${playerId}`;
            outputBoard.textContent = `Board: ${JSON.stringify(board)}`;
            outputWinner.textContent = `Winner: ${winner}`;
        })
        .catch(error => {
            outputError.textContent = `Error: ${error}`;
        });
}

export async function turno(casilla) {
    console.log(playerId);
    return fetch(`${API_BASE_URL}/turno/${gameId}`, {
        method: "PUT",
        headers: {
            "Content-Type": "application/json"
        },
        body: JSON.stringify({ casilla, idJugador: playerId }),
    })
    .then(async(response) => {
        if (response.status === 404) {
            const errorText = await response.text();
            outputError.textContent = errorText;
            if (errorText === "Partida terminada por el host") {
                gameId = null;
                playerId = null;
                board = Array(9).fill(null);
                winner = null;

                outputGameId.textContent = "";
                outputPlayerXId.textContent = "";
                outputBoard.textContent = "";
                outputWinner.textContent = "";
            }
            throw new Error(errorText);
        } else {
            return response.json();
        }
    })
    .then(data => {
        board = data.board;
        winner = data.ganador;

        outputBoard.textContent = `Board: ${JSON.stringify(board)}`;
        outputWinner.textContent = `Winner: ${winner}`;
    })
    .catch(error => {
        console.error("Error:", error);
    });
}

export async function reloadBoard() {
    console.log(gameId);
    return fetch(`${API_BASE_URL}/actualizar/${gameId}`)
    .then(async(response) => {
        if (response.status === 404) {
            const errorText = await response.text();
            outputError.textContent = errorText;
            if (errorText === "Partida terminada por el host") {
                gameId = null;
                playerId = null;
                board = Array(9).fill(null);
                winner = null;

                outputGameId.textContent = "";
                outputPlayerXId.textContent = "";
                outputBoard.textContent = "";
                outputWinner.textContent = "";
            }
            throw new Error(errorText);
        } else {
            return response.json();
        }
    })
    .then(data => {
        board = data.board;
        console.log(board);
        winner = data.ganador;
        console.log(winner);
    })
    .catch(error => console.error("Error:", error));
}

export async function leaveGame() {
    return fetch(`${API_BASE_URL}/delete/${gameId}/${playerId}`, {
        method: "DELETE",
    })
        .then(response => response.json())
        .then(data => {
            gameId = null;
            playerId = null;
            board = Array(9).fill(null); // Reiniciar el tablero
            winner = null;

            outputGameId.textContent = "";
            outputPlayerXId.textContent = "";
            outputBoard.textContent = "";
            outputWinner.textContent = "";
        })
        .catch(error => {
            outputError.textContent = `Error: ${error}`;
        });
}

export async function resetGame() {
    return fetch(`${API_BASE_URL}/reset/${gameId}`, {
        method: "PUT",
    })
        .then(response => response.json())
        .then(data => {
            board = Array(9).fill(null); // Reiniciar el tablero
            winner = null;

            outputBoard.textContent = `Board: ${JSON.stringify(board)}`;
            outputWinner.textContent = `Winner: ${winner}`;
        })
        .catch(error => {
            outputError.textContent = `Error: ${error}`;
        });
}
